import axios from 'axios';

export const UserRegistration = (data) => {

    data = {
        Email:RegistrationEmail,
        Username: RegistrationUsername,
        Password: RegistrationPassword,
    };

    return axios.post('http://localhost:4000/users/register',data)
        .then(res => res.status);
};
